export class NeuralNetwork {

    numANodes: number
    numBNodes: number
    numCNodes: number
    abWeights: number[][]
    bcWeights: number[][]
    activationFunction: ActivationFunction = ActivationFunctions.SIGMOID

    constructor(_numANodes: number, _numBNodes: number, _numCNodes: number) {
        
        this.numANodes = _numANodes
        this.numBNodes = _numBNodes
        this.numCNodes = _numCNodes

        this.abWeights = randomMatrix(this.numBNodes, this.numANodes)
        this.bcWeights = randomMatrix(this.numCNodes, this.numBNodes)

    }

    query(inputs: number[]): number[] {

        const inputsAsMatrix: number[][] = Matrix.transpose(Matrix.arrToMatrix(inputs))
        const hiddenInputs: number[][] = Matrix.dotProduct(this.abWeights, inputsAsMatrix)
        const hiddenOutputs: number[][] = Matrix.scaleMatrix(hiddenInputs, this.activationFunction.output)

        const finalInputs: number[][] = Matrix.dotProduct(this.bcWeights, hiddenOutputs)
        const finalOutputs: number[][] =  Matrix.scaleMatrix(finalInputs, this.activationFunction.output)
        return flatten(finalOutputs)

    }

    test(): void {
        console.log('wwwww')
    }

    loadWeights(): any {
        const obj = JSON.parse(weights)
        this.abWeights = obj.abWeights
        this.bcWeights = obj.bcWeights
    }

}

